// ==UserScript==
// @name         Prolific Notifier
// @namespace    https://github.com/Nebur96
// @version      1.0.0
// @description  Notifies you of any new studies that you received.
// @author       rfpereira
// @icon         https://styles.redditmedia.com/t5_32jqs/styles/communityIcon_mshb1tz28r261.png?width=256&s=10f45eb04cac21e8b5cd31dceb13a00f265508d5
// @include      https://*.prolific.co/*
// ==/UserScript==

function playAlertSound() {
    var audio = new Audio("data:audio/ogg;base64,");
    audio.play();
}

const app = document.querySelector('div#app');

const observer = new MutationObserver((mutations) => {
    mutations.forEach((mutation) => {
        if (mutation.addedNodes) {
            const studyAdded = [...mutation.addedNodes].some((node) => node.querySelector('.list-item'));
            if (studyAdded) {
                playAlertSound();
            }
        }
    });
});

observer.observe(app, { childList: true, subtree: true });
